extension.description.full.message:
PreMiD adalah sarana sing gampang lan bisa diatur sing ngijini sampeyan nunjuake apa sing sampeyan lakoni ing web lan Discord now playing status.

Contone, nalika sampeyan nonton video ing YouTube, ekstensi kita njupuk kabeh informasi sing dibutuhake saka halaman kasebut lan dikirim menyang app, setelah iku bakal ngganti status Discord sampeyan.

PreMiD ndhukung luwih saka 500 situs web lan isih berkembang, amarga komunitas sing kuwat nambahake Presence anyar saben dina.

Kanggo nggunakake PreMiD, sampeyan kudu nambah ekstensi iki lan nginstal app PreMiD sing ditemokake ing situs web kita. Alasane amarga Discord Rich Presence SDK kerja cara kaya ngono.

